class SORTracker(object):

    def __init__(self):
        self.countGet=0
        self.tracker=[]
        self.scores={}
        self.highestScore=0


    def add(self, name, score):
        if score not in self.scores:
            self.scores[score]=Score()
            if score>self.highestScore:
                self.tracker.insert(0, name)
                self.highestScore=score
            else:
                maxSmallScore=0
                for i in self.scores:
                    if i<score and i>maxSmallScore:
                        maxSmallScore=i
                if maxSmallScore!=0:
                    self.tracker.insert(self.scores[maxSmallScore].startIndex, name)
                    self.scores[score].startIndex=self.scores[score].endIndex= self.scores[maxSmallScore].startIndex
                else:
                    self.tracker.append(name)
                    self.scores[score].startIndex=self.scores[score].endIndex= len(self.tracker)-1

        else:
            start, end=self.scores[score].startIndex, self.scores[score].endIndex 
            for i in range(start, end+1):
                if name<self.tracker[i]:
                    self.tracker.insert(i, name)
                    break
            else:
                self.tracker.insert(end+1, name)
            self.scores[score].endIndex+=1

        # print(self.tracker)
        for i in self.scores:
            if i<score:
                self.scores[i].startIndex+=1
                self.scores[i].endIndex+=1


    def get(self):
        self.countGet+=1
        return self.tracker[self.countGet-1]

